function Profiletab()
{
    return(
        <div className="row">
            <div class="col profile-name col-md-auto">
            <p><a href="#">Username</a></p>
            </div>
            <div class="col">
            <p><a href="#">Sign out</a></p>
            </div>
      </div>
    );
}

export default Profiletab
